/*******************************************************************************************************
 * 関数名	fnc_DB_RaceMember_Trainee_Data
 * 概要		idから出走キャラのデータを取得
 * I/O		id		: 出走キャラ
 * return	出走キャラのデータ
 * 更新日	2025/09/20	新規
 *******************************************************************************************************/
function fnc_DB_RaceMember_Trainee_Data(CupId, RaceId) {
	let idx = 0;
	let retArr = [];

	while(idx < DB_RaceMember_Trainee.length) {
		if(
			(DB_RaceMember_Trainee[idx][enum_DB_Trainee.CupID] == CupId)
				&&
			(DB_RaceMember_Trainee[idx][enum_DB_Trainee.RaceID] == RaceId)
		) {
			retArr.push(DB_RaceMember_Trainee[idx]);
		}
		
		++idx;
	}

	return retArr;
}

/*******************************************************************************************************
 * 関数名	fnc_DB_Split_GoalTime
 * 概要		ゴールタイムのデコード
 * I/O		time	: ゴールタイム
 * return	変換後のゴールタイム
 * 更新日	2025/09/20	新規
 *******************************************************************************************************/
function fnc_DB_Split_GoalTime(time) {
	let retTime = "";

	// 分
	retTime = Math.trunc(time / 600) + ":";
	// 秒
	retTime += (Math.trunc(time / 10) % 60) + ".";
	// コンマ秒
	retTime += time % 10;

	return retTime;
}
